import React from "react";
import ReactDOM from "react-dom";
import Course from "./components/Course";

const App = () => {
  return (
    <div>
      {courses.map((course, i) => (
        <Course key={i} course={course} />
      ))}
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
